import React from "react"

function IndexItem(props) {
    return (
        <div className="index-item" style={props.index !== 1 ? {borderTop: "1px solid black"} : {border: ""}}>
            <h2>{props.header}</h2>
            <p>{props.text}</p>
        </div>
    )
}

export default IndexItem
